export default function LogoBar() {
    return (
        <div id="logoBar" className="d-flex">
            <span id="combinedLogo">
                <span id="streetText">sympto-street</span>
            </span>
            <button id="mediaQueriedSearch">Search</button>
        </div>
    )
}
